import React from 'react';

const History = () => {
    // Mock data - Asli project mein yeh database se aayega
    const mockHistory = [
        { id: 1, name: "deepfake_obama.mp4", result: "FAKE", confidence: "98.2%", date: "2026-02-20", status: "Critical" },
        { id: 2, name: "interview_raw.mp4", result: "REAL", confidence: "99.1%", date: "2026-02-19", status: "Safe" },
        { id: 3, name: "sora_gen_04.mp4", result: "FAKE", confidence: "85.4%", date: "2026-02-18", status: "High Risk" },
        { id: 4, name: "cctv_footage.mp4", result: "REAL", confidence: "92.0%", date: "2026-02-18", status: "Safe" },
    ];

    return (
        <div style={{ padding: '40px', animation: "fadeIn 1s ease" }}>
            <h2 style={{ color: '#38bdf8', marginBottom: '30px', textTransform: 'uppercase', letterSpacing: '2px' }}>
                üìÇ Global Threat Logs
            </h2>
            
            <div style={{ 
                overflow: 'hidden', 
                borderRadius: '15px', 
                border: '1px solid #334155',
                background: 'rgba(30, 41, 59, 0.7)',
                backdropFilter: 'blur(10px)'
            }}>
                <table style={{ width: '100%', borderCollapse: 'collapse', color: '#cbd5e1' }}>
                    <thead>
                        <tr style={{ backgroundColor: '#0f172a', textAlign: 'left' }}>
                            <th style={styles.th}>Source File</th>
                            <th style={styles.th}>AI Verdict</th>
                            <th style={styles.th}>Confidence</th>
                            <th style={styles.th}>Timestamp</th>
                            <th style={styles.th}>Security Status</th>
                        </tr>
                    </thead>
                    <tbody>
                        {mockHistory.map((item, index) => (
                            <tr key={item.id} style={{ 
                                borderBottom: '1px solid #334155',
                                backgroundColor: index % 2 === 0 ? 'transparent' : 'rgba(15, 23, 42, 0.3)',
                                transition: '0.3s'
                            }} className="table-row">
                                <td style={styles.td}>üíæ {item.name}</td>
                                <td style={{ 
                                    ...styles.td, 
                                    color: item.result === "FAKE" ? "#f87171" : "#4ade80",
                                    fontWeight: 'bold'
                                }}>
                                    {item.result}
                                </td>
                                <td style={styles.td}>{item.confidence}</td>
                                <td style={styles.td}>{item.date}</td>
                                <td style={styles.td}>
                                    <span style={{
                                        padding: '4px 10px',
                                        borderRadius: '20px',
                                        fontSize: '12px',
                                        backgroundColor: item.result === "FAKE" ? 'rgba(239, 68, 68, 0.2)' : 'rgba(34, 197, 94, 0.2)',
                                        color: item.result === "FAKE" ? '#ef4444' : '#22c55e',
                                        border: `1px solid ${item.result === "FAKE" ? '#ef4444' : '#22c55e'}`
                                    }}>
                                        ‚óè {item.status}
                                    </span>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>

            <style>{`
                .table-row:hover {
                    background-color: rgba(56, 189, 248, 0.1) !important;
                    transform: scale(1.01);
                    cursor: pointer;
                }
                @keyframes fadeIn { from { opacity: 0; } to { opacity: 1; } }
            `}</style>
        </div>
    );
};

const styles = {
    th: { padding: '15px 20px', color: '#38bdf8', fontSize: '14px', textTransform: 'uppercase' },
    td: { padding: '15px 20px', fontSize: '15px' }
};

export default History;
